import React from "react";
const Home = () => {
    return (
        <div>
            <h1>Welcome To Home Page</h1>
            <h2>Crowned Company</h2>
            <h3 style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                <img src="/favicon.ico" alt="Favicon" style={{ width: '300px', height: '300px' }} />
            </h3>

            
        </div>
    );
};

export default Home;
